description:
A new action film by Francesco Fanelli full by surprisingly turns and more beautiful women! International stars like Bambola, Big Willy and Marco Nero involved in dirty deals with the Italian Mafia and the Chinese police. Despite an unprecedented career even the best agents are paid by both the fast money and by the horny girls fascinated and corrupt ... but for that you need with an exciting life in constant danger ...

